Here's what I have so far for cors:

```javascript
 app.use(cors({
    origin: 'http://localhost:3000'
}))
```

And here is my fetch:
```
 fetch('http://localhost:5000/Question', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({
                title: e.target.elements.title.value,
                content: e.target.elements.content.value
            }),
        })
        .then(res => res.json())
```

Answers.answerContent:
Your cors is missing curcial setting to allow credentials use:


```javascript
  app.use(cors({
    origin: 'http://localhost:3000', 
    credentials: true
}))
```

As for Fetch, you are missing the same part (include credentials)

```javascript

fetch('http://localhost:5000/Question', {
            method: 'POST',
            credentials: 'include',
            =======================
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({
                title: e.target.elements.title.value,
                content: e.target.elements.content.value
            }),
        })
        .then(res => res.json())

```
